import React from 'react';
import { Context } from '../App2';

export default ({id, text, done, deletefunction, donefunction}) => {
    return (
        <Context.Consumer>
            {
                (obj) => {
                    return (
                        <>
                        <input type="checkbox" defaultChecked={done ? 'checked': ''} onClick={() => obj.done(id)}/>
                        <p className={done ? 'done': ''}>{text}</p>
                        <button onClick={() => obj.de}>REMOVE</button>
                        </>
                    );
                }
            }
        </Context.Consumer>
    );
}
